import React, { Component } from "react";
import { Table, Button, Form } from "react-bootstrap";

class BusinessApplicationList extends Component {
  constructor() {
    super();
    this.state = {
      businessApplications: [
        "Big Business",
        "Small Business",
        "Average Business",
        "Wealthy Business",
        "Mediocre Business",
      ],
    };
  }

  render() {
    return (
      <div>
        {/* Table */}
        <Table>
          <thead>
            <th>Business</th>
            <th>Approve</th>
            <th>Deny</th>
          </thead>
          <tbody>
            {/* Map each value */}
            {this.state.businessApplications.map((business) => {
              return (
                <tr>
                  {/* Need to have the course as a link, to display a full page with the course's details */}
                  <td>{business}</td>
                  <td>
                    <Form.Check
                      type="checkbox"
                      // selected={this.state.}
                      // onClick={this.onClick}
                    />
                  </td>
                  <td>
                    <Form.Check
                      type="checkbox"
                      // selected={this.state.}
                      // onClick={this.onClick}
                    />
                  </td>
                </tr>
              );
            })}
          </tbody>
        </Table>
        {/* Button to submit choices */}
        <Button type="submit">Submit</Button>
      </div>
    );
  }
}

export default BusinessApplicationList;
